import Link from 'next/link';

import LinkBicameral from '../components/LinkBicameral';
import LinkSecurity from '../components/LinkSecurity';
import LinkUnicameral from '../components/LinkUnicameral.js';



const Committees = () =>{
        return (

/*     <React.Fragment> */
 
      <div className="Badges__container">
        <h1>Comites de Crisis Disponibles</h1> 
 

              <Link ><a href="/comite/unicameral">
                  <LinkUnicameral />
              </a>
              </Link>
  
              <Link ><a href="/comite/bicameral">
                  <LinkBicameral />

              </a>
              </Link>
  
              <Link><a href="/comite/security">
                  <LinkSecurity />
                </a>    
              </Link>
 

        <style jsx>{`          
          .Badges__container {
            width: 100%;
            display: grid ;
            grid-gap: 15px;
            padding: 15px;
            grid-template-columns: repeat(auto-fill, minmax(250px, 1fr));
            height: auto;
            text-align: center;
          }  
          
          
          .Badges_conf-logo {
            margin-bottom: 2rem;
            width: 260px;
          }

          
          .Badges__buttons a {
            padding: 10px 10px 10px 10px;
            width: 100%;
            text-decoration: none;
          }
          
          
          .Badges__buttons_two {
            display: flex;
            justify-content: flex-end;
            margin-bottom: 1rem;
          }
        `}</style>
      </div>
/*       </React.Fragment> */
        )

   }   

 
 
 export default Committees;
